&quot;Kids in America&quot; is a New Wave song by British singer Kim Wilde, released in the United Kingdom as her debut single in 1981, and in the US in 1982. The song peaked at number two on the UK singles chart. The following year it became a Top 30 hit in the US. In the summer of 1981, the track appeared on Wilde's self-titled debut album.


